// src/components/CalComCalendar.tsx
import React, { useEffect, useState } from 'react';
import Cal, { InlineWidget } from '@calcom/sdk'; // Adjust based on Cal.com SDK documentation

const CalComCalendar: React.FC = () => {
  const [isLoaded, setIsLoaded] = useState(false);

  useEffect(() => {
    // Initialize Cal.com SDK if required
    Cal.init({
      clientId: 'YOUR_CALCOM_CLIENT_ID',
      // Other necessary initialization parameters
    });
    setIsLoaded(true);
  }, []);

  return (
    <div className="calendar-container">
      {isLoaded ? (
        <InlineWidget 
          url="https://cal.com/your-username" // Your Cal.com booking URL
          // Add other props based on SDK documentation
        />
      ) : (
        <p>Loading...</p>
      )}
    </div>
  );
};

export default CalComCalendar;
